import React from 'react'
import '../assets/css/suggestion.css'

function Suggestions() {
    return (
        <div className="suggestion p-4">
            <div className="suggestion-user">userinfo</div>
            <div className="suggestion-foryou">foryou</div>
            <div className="suggestions-users">usersAll</div>
        </div>
    )
}

export default Suggestions
